import styles from './styles/sideMenu.module.css'

function SideMenu ({menuClicked, changeMenuClicked}) {
    return (
        <div className={`${menuclicked ? "absolute transform -left-0 transition-all ease-out duration-500": "absolute -translate-y-24"}  h-full w-11/12 bg-white`}
            onClick={changeMenuClicked}
        >
            <h1>Side Menu</h1>
        </div>
    )
}

export default SideMenu
